import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';

function Note(props){
    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button><EditIcon/></button>
            <button onClick = {()=>{
                props.onDelete(props.id)
            }}><DeleteIcon /></button>
        </div>
    );
}

export default Note;
